test("Parses simple names", () => {
  expect(getItem(card_fireball_mb1, "name")).toContain("Fireball");
  expect(getItem(card_balduvian_bears_dkm, "name")).toContain(
    "Balduvian Bears"
  );
  expect(getItem(card_swords_to_plowshares_v13, "name")).toContain(
    "Swords to Plowshares"
  );
  expect(getItem(card_doubling_season_rav, "name")).toContain(
    "Doubling Season"
  );
  expect(getItem(card_mycosynth_lattice_dst, "name")).toContain(
    "Mycosynth Lattice"
  );
  expect(getItem(card_plains_eld, "name")).toContain("Plains");
});

test("Parses weird names", () => {
  expect(getItem(card_aether_adept_ddm, "name")).toContain("Aether Adept");
  expect(getItem(card_legions_of_lim_dul_tsp, "name")).toContain(
    "Lim-Dûl the Necromancer"
  );
  expect(getItem(card_erase_unh, "name")).toContain(
    "Erase (Not the Urza's Legacy One)"
  );
  expect(getItem(card_long_unh, "name")).toContain(
    "Our Market Research Shows That Players Like Really Long Card Names So " +
      "We Made this Card to Have the Absolute Longest Card Name Ever Elemental"
  );
});

